import React from 'react';

function Celda({ value }) {
    return (
        <div>
            <button
                className="cell text-success"
                style={{ minWidth: 50, minHeight: 50, fontSize: '20px' }}
            >
                {/* Contenido de la celda */}
                {value}
            </button>
        </div>
    );
}

export default Celda;
